import React from 'react'


class Footer extends React.Component {
    render() {
        return (
            <React.Fragment>
                <footer className="footer">
                    <div className="footer__block">
                        <p>&copy; 2020 Joanna Lepiesza.</p>
                    </div>
                </footer>
            </React.Fragment>
        )
    }
} 

export default Footer
